DROP TABLE IF EXISTS x_world;
CREATE TABLE x_world(
	id INTEGER PRIMARY KEY,
	x INTEGER NOT NULL,
	y INTEGER NOT NULL,
	tid INTEGER NOT NULL,
	vid INTEGER NOT NULL,
	village VARCHAR(100),
	pid INTEGER NOT NULL,
	player VARCHAR(100),
	aid INTEGER NOT NULL,
	alliance VARCHAR(100),
	population INTEGER
